import { View, Text } from "react-native";

import React from "react";
import { useNavigation } from "@react-navigation/native";
import { Drawer, DrawerItem } from "../../components/Drawer";

const ShelterDashboardScreen = ({ route }) => {
  const navigation = useNavigation();

  const { shelterId } = route.params;

  return (
    <View>
      <Drawer>
        <DrawerItem icon='home'></DrawerItem>
        <DrawerItem icon='add-circle'></DrawerItem>
        <DrawerItem icon='bed'></DrawerItem>
        <DrawerItem icon='account-group'></DrawerItem>
        <DrawerItem icon='apple'></DrawerItem>
      </Drawer>
    </View>
  );
};

export default ShelterDashboardScreen;
